import React from 'react';
import './Nav.css';
import {Link, NavLink} from 'react-router-dom';

const Nav = () =>{
    return(
    <div className="nav">
        <ul>
            <li>
                <Link to="/AddNewClient">הוסף לקוח חדש</Link>
                <a href="/AddNewNote">הוסף פתק חדש</a>
            </li>
        </ul>
    </div>
    )
}

export default Nav;
